import React from "react";
import TagWrapper from "../styled/commonStyled/TagWrapper";
import { useSelector, useDispatch } from "react-redux";
import { getSearch } from "../../redux/module/search";
const Tag = ({ post, children }) => {
  const dispatch = useDispatch();
  const handleClick = async (e) => {
    await dispatch(getSearch(e.target.innerText));
  };
  return (
    <div>
      <TagWrapper onClick={handleClick}>{children}</TagWrapper>
    </div>
  );
};

export default Tag;
